import React from 'react';
import './App.css';

import SignIn from './components/signIN/signIn.jsx'
import SignUp from './components/signUP/signUp.jsx'
import LinkList from './components/LinkList'

import { Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Switch>
            <Route
              exact
              path="/"
              component={() => <SignIn />}
            />
            <Route
              exact
              path="/SignUp"
              component={() => <SignUp />}
            />
            <Route
              exact
              path="/test"
              component={() => <LinkList />}
            />
          </Switch>
  );
}

export default App;
